export class HoverRangeAnchor{constructor(t,e,i,r){this.priority=t,this.range=e,this.initialMousePosX=i,this.initialMousePosY=r,this.type=1}equals(t){return 1===t.type&&this.range.equalsRange(t.range)}canAdoptVisibleHover(t,e){return 1===t.type&&e.lineNumber===this.range.startLineNumber}}export class HoverForeignElementAnchor{constructor(t,e,i,r,s){this.priority=t,this.owner=e,this.range=i,this.initialMousePosX=r,this.initialMousePosY=s,this.type=2}equals(t){return 2===t.type&&this.owner===t.owner}canAdoptVisibleHover(t,e){return 2===t.type&&this.owner===t.owner}}export const HoverParticipantRegistry=new class{constructor(){this._participants=[]}register(t){this._participants.push(t)}getAll(){return this._participants}};